import React from 'react';
import style from './App.module.css';
import TopScreen from "./Components/TopScreen/TopScreen";
import Frame from "./Components/Frame/Frame";
import Footer from "./Components/Footer/Footer";
import '@vkontakte/vkui/dist/fonts.css';
import Example from "./Components/EpicBlock/EpicBlock";
import {
    AdaptivityProvider,
    AppRoot,
    ConfigProvider,
    PanelHeader,
    SplitCol,
    SplitLayout,
    ViewWidth, withAdaptivity
} from "@vkontakte/vkui";
import Navigator from "./Components/Navigator/Navigator";
import MainScreens from "./Components/MainScreens/MainScreens";

//
function App({ viewWidth }) {
    return (
        <ConfigProvider>
            <AdaptivityProvider>
                <AppRoot>
                    <SplitLayout
                        header={
                            viewWidth >= ViewWidth.SMALL_TABLET && <PanelHeader separator={false} />
                        }
                    >
                        {viewWidth === ViewWidth.DESKTOP && (
                            <SplitCol width={280}>
                                <Navigator/>
                            </SplitCol>
                        )}
                            <SplitCol
                                spaced={viewWidth >= ViewWidth.SMALL_TABLET}
                                animate={viewWidth <= ViewWidth.MOBILE}
                            >
                                <MainScreens/>
                            </SplitCol>

                    </SplitLayout>
                </AppRoot>
            </AdaptivityProvider>
        </ConfigProvider>

            );
}
App = withAdaptivity(App, { viewWidth: true });
export default App;
